import Layout from '../components/Layout';
import PropertyDetails from '../components/PropertyDetails';
const MyPropertiesThird = ()=> (
<Layout>
    <div className='container'>
        <div className='row'>
            <div className='col-12'>
            <h5>MY PROPERTIES</h5>
            <PropertyDetails/>
            </div>
        </div>
        <div className='propIcon row'>
            <div className='col-md-4 col-12'>
                <p className="text-center">NO 3 CHEVRON DRIVE</p>
            </div>
            <div className='col-md-4 col-12'>
                <p className="text-center">Term set for suite 4 apartment</p>
            </div>
            
            
        </div>
    </div>
    <style global jsx>{`
        body{
            background:#f4f5f7;
        }
    `}
    </style>
</Layout>
);
export default MyPropertiesThird;
